import React, { Component } from "react";

class R074_ReactCurrying extends Component{
    pluNumOrString(c, d){
        return c+d;
    }

    PlusFunc1(a){
        return function(b){
            return this.plusNumOrString(a, b)
        }.bind(this)
    }

    PlusFunc2 = a = b => this.plusNumOrString(a, b)

    PlusFunc(a){
        return this.PlusFunc1(a)(200);
    }

    render() {
        return(
            <>
                <input id="id" type="text" ref={this.InputRef} />
                <input type="button" value="Ref Focus" onClick={this.RefFocus} />
                <input type="button" value="Javascript Focus" onClick={this.JavascriptFocus}/>
            </>
        )
    }
}

export default R074_ReactCurrying;
